import React from 'react';
import 'antd/dist/antd.css';
import Head from 'next/head';
import wrapper from 'next-redux-wrapper';


const JStargram = ({Component}) =>{
    return(
        <>
        <Head>
            <meta charSet="utf-u" />
            <title>JStargram</title>
        </Head>
        <Component />
        </>
    )
}



export default JStargram;
